- vị trí cực đẹp, căn hộ thuộc chung cư ct12 văn phú – cạnh vitoria văn phú, đối diện cột đồng hồ, nằm trọn trong kđt văn phú, tiện ích không thiếu thứ gì;
- trung tâm hà đông, giao thông đi lại tiện lợi, gần đường tàu điện trên cao hà đông – cát linh, gần bến xe yên nghĩa, gần bệnh viện 103, hv quân y, trường thpt chuyên nguyễn huệ, tttm metro hà đông…;
