- diện tích căn hộ: 66m2, được bố trí hợp lý gồm: 2 ngủ + 2 wc +  bếp + 1 khách;
- căn hộ ở tầng trung full nội thất chỉ việc xách va ly về ở;
- nhà hiện đang cho thuê dòng tiền 12tr/tháng.
